INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (1, 3, 1, N'The Hitchhiker''s Guide to the Galaxy', N'Seconds before the Earth is demolished to make way for a galactic freeway, Arthur Dent is plucked off the planet by his friend Ford Prefect, a researcher for the revised edition of The Hitchhiker''s Guide to the Galaxy who, for the last fifteen years, has been posing as an out-of-work actor.

Together this dynamic pair begin a journey through space aided by quotes from The Hitchhiker''s Guide ("A towel is about the most massively useful thing an interstellar hitchhiker can have") and a galaxy-full of fellow travelers: Zaphod Beeblebrox—the two-headed, three-armed ex-hippie and totally out-to-lunch president of the galaxy; Trillian, Zaphod''s girlfriend (formally Tricia McMillan), whom Arthur tried to pick up at a cocktail party once upon a time zone; Marvin, a paranoid, brilliant, and chronically depressed robot; Veet Voojagig, a former graduate student who is obsessed with the disappearance of all the ballpoint pens he bought over the years.', 5, )
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (2, 3, 1, N'The Restaurant at the End of the Universe', N'Facing annihilation at the hands of the warlike Vogons is a curious time to have a cosmically displaced Arthur Dent and his curious comrades in arms as they hurtle through space powered by pure improbability - and desperately in search of a place to eat. Among Arthur''s motley shipmates are Ford Prefect, a long-time friend and contributor to the The Hitch Hiker''s Guide to the Galaxy; Zaphod Beeblebrox, the three-armed, two-headed ex-president of the galaxy; Tricia McMilan, a fellow Earth refuge who''s gone native (her name is Trillian now); and Marvin, who suffers nothing and no one gladly.', 5, )
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (3, 3, 1, N'Life, the Universe and Everything', N'The unhappy inhabitants of planet Krikkit are sick of looking at the night sky above their heads–so they plan to destroy it. The universe, that is. Now only five individuals stand between the killer robots of Krikkit and their goal of total annihilation.

They are Arthur Dent, a mild-mannered space and time traveler who tries to learn how to fly by throwing himself at the ground and missing; Ford Prefect, his best friend, who decides to go insane to see if he likes it; Slartibartfast, the indomitable vice president of the Campaign for Real Time, who travels in a ship powered by irrational behavior; Zaphod Beeblebrox, the two-headed, three-armed ex-president of the galazy; and Trillian, the sexy space cadet who is torn between a persistent Thunder God and a very depressed Beeblebrox.

How will it all end? Will it end? Only this stalwart crew knows as they try to avert “universal” Armageddon and save life as we know it–and don’t know it!', 4, NULL)
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (4, 3, 1, N'So Long, and Thanks for All the Fish', N'Back on Earth with nothing more to show for his long, strange trip through time and space than a ratty towel and a plastic shopping bag, Arthur Dent is ready to believe that the past eight years were all just a figment of his stressed-out imagination. But a gift-wrapped fishbowl with a cryptic inscription, the mysterious disappearance of Earth''s dolphins, and the discovery of his battered copy of The Hitchhiker''s Guide to the Galaxy all conspire to give Arthur the sneaking suspicion that something otherworldly is indeed going on. . . .

God only knows what it all means. And fortunately, He left behind a Final Message of explanation. But since it''s light-years away from Earth, on a star surrounded by souvenir booths, finding out what it is will mean hitching a ride to the far reaches of space aboard a UFO with a giant robot. But what else is new?', 4, NULL)
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (5, 3, 1, N'Mostly Harmless', N'It’s easy to get disheartened when your planet has been blown up, the woman you love has vanished due to a misunderstanding about space/time, the spaceship you are on crashes on a remote and Bob-fearing planet, and all you have to fall back on are a few simple sandwich-making skills. However, instead of being disheartened, Arthur Dent makes the terrible mistake of starting to enjoy life a bit–and immediately all hell breaks loose.

Hell takes a number of forms: there’s the standard Ford Prefect version, in the shape of an all-new edition of The Hitchhiker’s Guide to the Galaxy, and a totally unexpected manifestation in the form of a teenage girl who startles Arthur Dent by being his daughter when he didn’t even know he had one.

Can Arthur save the Earth from total multidimensional obliteration? Can he save the Guide from a hostile alien takeover? Can he save his daughter, Random, from herself? Of course not. He never works out exactly what is going on. Will you?', 4, NULL)
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (6, 1, 0, N'Do Androids Dream of Electric Sheep?', N'It was January 2021, and Rick Deckard had a license to kill.Somewhere among the hordes of humans out there, lurked several rogue androids. Deckard''s assignment--find them and then..."retire" them. Trouble was, the androids all looked exactly like humans, and they didn''t want to be found!', 4, )
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (7, 1, 0, N'A Scanner Darkly', N'Substance D is not known as Death for nothing. It is the most toxic drug ever to find its way on to the streets of LA. It destroys the links between the brain''s two hemispheres, causing, first, disorientation and then complete and irreversible brain damage.

The undercover narcotics agent who calls himself Bob Arctor is desperate to discover the ultimate source of supply. But to find any kind of lead he has to pose as a user and, inevitably, without realising what is happening, Arctor is soon as addicted as the junkies he works among...', 4, )
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (8, 1, NULL, N'The Man in the High Castle', N'It''s America in 1962. Slavery is legal once again. The few Jews who still survive hide under assumed names. In San Francisco, the I Ching is as common as the Yellow Pages. All because some twenty years earlier the United States lost a war — and is now occupied by Nazi Germany and Japan.

This harrowing, Hugo Award-winning novel is the work that established Philip K. Dick as an innovator in science fiction while breaking the barrier between science fiction and the serious novel of ideas. In it Dick offers a haunting vision of history as a nightmare from which it may just be possible to wake.', 3, NULL)
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (9, 2, 2, N'Jurassic Park', N'An astonishing technique for recovering and cloning dinosaur DNA has been discovered. Now humankind’s most thrilling fantasies have come true. Creatures extinct for eons roam Jurassic Park with their awesome presence and profound mystery, and all the world can visit them—for a price.Until something goes wrong. . . .In Jurassic Park, Michael Crichton taps all his mesmerizing talent and scientific brilliance to create his most electrifying technothriller.', 4, )
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (10, 2, 2, N'The Lost World', N'It is now six years since the secret disaster at Jurassic Park, six years since the extraordinary dream of science and imagination came to a crashing end – the dinosaurs destroyed, the park dismantled, the island indefinitely closed to the public.

There are rumors that something has survived....', 3, )
GO
INSERT [dbo].[Books] ([Id], [AuthorId], [SeriesId], [Title], [Description], [Rating], [CoverArt]) VALUES (11, 2, NULL, N'Timeline', N'In an Arizona desert, a man wanders in a daze, speaking words that make no sense. Within twenty-four hours he is dead, his body swiftly cremated by his only known associates. Halfway around the world, archaeologists make a shocking discovery at a medieval site. Suddenly they are swept off to the headquarters of a secretive multinational corporation that has developed an astounding technology. Now this group is about to get a chance not to study the past but to enter it. And with history opened up to the present, the dead awakened to the living, these men and women will soon find themselves fighting for their very survival -- six hundred years ago.', 3, NULL)
GO
