CREATE PROCEDURE [dbo].[spGetAllBooks] 

AS
BEGIN
	
	SET NOCOUNT ON;

    SELECT b.Id, b.AuthorId, a.FirstName, a.LastName, b.SeriesId, s.SeriesName, 
			b.Title, b.CoverArt, b.Description, b.Rating
	FROM dbo.Books AS b
	LEFT JOIN dbo.Authors AS a ON a.Id = b.AuthorId
	LEFT JOIN dbo.Series AS s ON s.Id = b.SeriesId;
END
